import { useQuery } from '@apollo/react-hooks';
import gql from 'graphql-tag';

function App() {
  const HELLO = gql`
    query SayHello {
      hello(name: "mark")
    }
  `;

  const { data, loading, error } = useQuery(HELLO);

  if (data) {
    console.log(data);
  }
  return (
    <div className='container'>
      <p> hello </p>
    </div>
  );
}

export default App;
